description:
Everyone in a high school is suddenly transported to another world. As they are attacked by monsters they find that some of the students now have superpowers. They organize themselves into two groups. Those without powers are called the Stay Home Group and those with them are called the Exploration Group. On a day where most of the Exploration Group is out, the remaining ones that stay behind start the slaughtering and raping of the Stay Home Group.

Here we meet our protagonist, an average guy with no abilities who had just barely escaped death at the hands of his schoolmates. He ends up far away in a cave on the verge of death, exhausted and wounded when a slime enters the cave and starts eating away at his hand. All he can do is utter, &ldquo;&hellip;please&hellip; someone out there&hellip; help me&hellip;.&rdquo;

Ukrainian/Українською: [spoiler]Нахабно учнів школи було перенесено в хащі фентезійного світу. Водночас одразу почався набіг монстрів. Утім, деякі школярі були наділені надздібностями, завдяки яким їм вдається відбитись від монстрів. Упродовж нестерпних декількох днів учні поділились на робітничу та розвідувальну групи. Метою Розвідки було запобігати небезпекам, надавати інформацію про навколишній світ, його мешканців та підтримувати устрій у колонії. Через певний час більша частина розвідувальної групи вирушила на схід цього загадкового лісу. Наступним викликом для учнів стануть не звичайні монстри, а чудовиська, які ховаються усередині них самих. З цього й починається історія головного героя, середньостатистичного підлітка без надздібностей, який тільки-но уник смерті. Плазом, ледве притомним дістався до печери, перебуваючи у стані між життям та смертю. До нього підповзає монстр; діставшись до головного героя, почвара починає поглинати його руку, а все, на що він спроможний, &ndash; це горлати про допомогу.[/spoiler]

